import "foundation-sites/dist/css/foundation.min.css";

// import components
import { Button, Colors } from "react-foundation";
import * as Foundation from "react-foundation";
export const Tuan = () => {
  return (
    <>
      <Button color={Colors.SUCCESS}>Submit</Button>
      <Foundation.Row>
        <Foundation.Column
          small={12}
          medium={6}
          large={4}
          xlarge={2}
          xxlarge={1}
        >
          1
        </Foundation.Column>
        <Foundation.Column
          small={12}
          medium={6}
          large={4}
          xlarge={2}
          xxlarge={1}
        >
          2
        </Foundation.Column>
        <Foundation.Column
          small={12}
          medium={6}
          large={4}
          xlarge={2}
          xxlarge={1}
        >
          3
        </Foundation.Column>
        <Foundation.Column
          small={12}
          medium={6}
          large={4}
          xlarge={2}
          xxlarge={1}
        >
          4
        </Foundation.Column>
        <Foundation.Column
          small={12}
          medium={6}
          large={4}
          xlarge={2}
          xxlarge={1}
        >
          5
        </Foundation.Column>
        <Foundation.Column
          small={12}
          medium={6}
          large={4}
          xlarge={2}
          xxlarge={1}
        >
          6
        </Foundation.Column>
        <Foundation.Column
          small={12}
          medium={6}
          large={4}
          xlarge={2}
          xxlarge={1}
        >
          7
        </Foundation.Column>
        <Foundation.Column
          small={12}
          medium={6}
          large={4}
          xlarge={2}
          xxlarge={1}
        >
          8
        </Foundation.Column>
        <Foundation.Column
          small={12}
          medium={6}
          large={4}
          xlarge={2}
          xxlarge={1}
        >
          9
        </Foundation.Column>
        <Foundation.Column
          small={12}
          medium={6}
          large={4}
          xlarge={2}
          xxlarge={1}
        >
          10
        </Foundation.Column>
        <Foundation.Column
          small={12}
          medium={6}
          large={4}
          xlarge={2}
          xxlarge={1}
        >
          11
        </Foundation.Column>
        <Foundation.Column
          small={12}
          medium={6}
          large={4}
          xlarge={2}
          xxlarge={1}
        >
          12
        </Foundation.Column>
      </Foundation.Row>
      <br></br>
      <Foundation.Grid className="display">
        <Foundation.Cell small={2} large={4}>
          4 columns
        </Foundation.Cell>
        <Foundation.Cell small={4} large={4}>
          4 columns
        </Foundation.Cell>
        <Foundation.Cell small={6} large={4}>
          4 columns
        </Foundation.Cell>
      </Foundation.Grid>
      <br></br>
      <Foundation.Menu>
        <Foundation.MenuItem>Menu 1</Foundation.MenuItem>
        <Foundation.MenuItem>Menu 2</Foundation.MenuItem>
        <Foundation.MenuItem>Menu 3</Foundation.MenuItem>
      </Foundation.Menu>
      <div className="button-basics-example">
        <Foundation.Link>Learn More</Foundation.Link>
        <Foundation.Link>View All Features</Foundation.Link>
        <Button color={Colors.SUCCESS}>Save</Button>
        <Button color={Colors.ALERT}>Delete</Button>
      </div>
      <div className="switch-radio-example">
        <Foundation.Switch
          input={{
            type: InputTypes.RADIO,
            name: "testGroup",
            defaultChecked: true,
          }}
        />
        <Foundation.Switch
          input={{ type: "radio", name: "testGroup" }}
        />
        <Foundation.Switch
          input={{ type: "radio", name: "testGroup" }}
        />
      </div>
    </>
  );
};
